import React from 'react'
import "./App.css";
import { useState } from 'react';
 function Mark() {
    const [ ta,setx]=useState('')
    const [ en,sety]=useState('')
    const [ ma,]=useState('')
    const [ sc,sets]=useState('')
    const [ so,seti]=useState('')
  return (
    <>
    <center> student mark</center>
   <div id="ca">
    <div><label  id="lb2"  >:tamil <input type="number" value={ta} onChange={(e)=>setx(e.target.value)}/></label></div>
    <div><label  id="lb2"> :english <input type="number" value={en} onChange={(e)=>sety(e.target.value)}/></label></div>
    <div><label id="lb2">:maths <input type="number" value={ma} onChange={(e)=>sety(e.target.value)}/></label></div>
    <div><label id="lb2"> :science<input type="number" value={sc} onChange={(e)=>sety(e.target.value)}/></label></div>
    <div><label id="lb2"> :social<input type="number" value={so} onChange={(e)=>sety(e.target.value)}/></label></div>
    <div><label id="lb2"> :total mark {parseInt(ta)+parseInt(en)+parseInt(ma)+parseInt(sc)+parseInt(so)}</label></div>
    <div><label id="lb2"> :total {parseInt(ta)+parseInt(en)+parseInt(ma)+parseInt(sc)+parseInt(so)/5}</label></div>
    <div> <label id="lb2"> :cut off {parseInt(ma)+parseInt(en)+parseInt(ma)+parseInt(sc)+parseInt(so)/5}</label></div>
    </div>
    
    
    </>
  );
}
export default Mark;
